import { defineConfig, InputOptions, OutputOptions } from 'rollup'
import typescript from '@rollup/plugin-typescript'
import dts from 'rollup-plugin-dts'

const plugins: InputOptions['plugins'] = []

const output: OutputOptions = {
  file: 'dist/index.mjs',
}

let input = 'src/index.ts'

if (process.env.BUILD === 'types') {
  plugins.push(dts())
  output.file = 'dist/index.d.ts'
  input = 'dist/index.d.ts'
} else if (process.env.BUILD === 'iife') {
  output.sourcemap = true
  output.name = '$arrow'
  output.format = 'iife'
  output.file = 'dist/index.js'
  plugins.push(
    typescript({
      sourceMap: false,
      exclude: ['rollup.config.ts', 'src/__tests__/**'],
    })
  )
} else {
  output.sourcemap = true
  plugins.push(
    typescript({
      sourceMap: false,
      exclude: ['rollup.config.ts', 'src/__tests__/**'],
    })
  )
}

const config = defineConfig({
  input,
  output,
  plugins,
})

export default config

{
  // see https://www.typescriptlang.org/tsconfig to better understand tsconfigs
  "include": ["src", "rollup.config.ts"],
  "ts-node": { "esm": true, "experimentalSpecifierResolution": "node" },
  "compilerOptions": {
    "module": "esnext",
    "lib": ["dom", "esnext"],
    "target": "ES2016",
    "importHelpers": true,
    // output .d.ts declaration files for consumers
    "declaration": true,
    // output .js.map sourcemap files for consumers
    "sourceMap": true,
    // match output dir to input dir. e.g. dist/index instead of dist/src/index
    // "rootDir": "./src",
    "outDir": "./dist",
    // stricter type-checking for stronger correctness. Recommended by TS
    "strict": true,
    // linter checks for common issues
    "noImplicitReturns": true,
    "noFallthroughCasesInSwitch": true,
    // noUnused* overlap with @typescript-eslint/no-unused-vars, can disable if duplicative
    "noUnusedLocals": true,
    "noUnusedParameters": true,
    // use Node's module resolution algorithm, instead of the legacy TS one
    "moduleResolution": "node",
    // interop between ESM and CJS modules. Recommended by TS
    "esModuleInterop": true,
    // significant perf increase by skipping checking .d.ts files, particularly those in node_modules. Recommended by TS
    "skipLibCheck": true,
    // error out if import and file system have a casing mismatch. Recommended by TS
    "forceConsistentCasingInFileNames": true
  }
}

import { defineConfig } from 'vitest/config'

export default defineConfig({
  test: {
    environment: 'jsdom',
  },
})
